import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Registration from './registration.html'; // Adjust the import as needed
import Login from './login.html'; // Adjust the import as needed

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/" exact component={Home} />
                <Route path="/registration" component={Registration} />
                <Route path="/login" component={Login} />
            </Switch>
        </Router>
    );
}

function Home() {
    return (
        <div>
            <h1>Healthcare Storage Platform</h1>
            <p>Welcome to the healthcare storage platform. Please navigate to the registration or login page.</p>
        </div>
    );
}

export default App;
